  return (
    <div className="container">
      <h1>About</h1>
      {/* {users.map((index) => (
        <div key={index.id}>
          <p>name :{index.name}</p>
        </div>
      ))} */}

      {users && <p>{users.title}</p>}
    </div>
  );
};

export default About;
